// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;
/**
 * @title Storage
 * @dev Store & retrieve value in a variable
 */
contract MaizeInsurance {

    /*
        * Main Variables *
        policy {
            - client_id: unsigned integer
            - policy_id: unsigned integer
            - maize_variety: string
            - start_date: uint256 => because we use epoch time
            - end_date: uint256
        } - struct
        - buyers_address: address
        - sellers_address: adress
    */

    address payable public client;
    address payable public insurer;

    struct Policy{
        uint client_id;
        uint policy_id;
        string maize_variety;
        uint256 start_date;
        uint256 end_date;
    }

    struct Variety{
        string variety_name;
        uint8[2] acceptable_monthly_rain_avgs;
        uint8[2] acceptable_monthly_temp_avgs;
        uint8[2] acceptable_weekly_rain_avgs;
        uint8[2] acceptable_weekly_temp_avgs;
    }

    Variety Hybrid_Series_5 = Variety("Hybrid Series 5", [100, 200], [18, 24], [100, 200], [18, 24]);
    Variety Hybrid_Series_6 = Variety("Hybrid Series 5", [100, 200], [18, 24], [100, 200], [18, 24]);


    Policy[] policies;
    Variety[] varieties; //this will hold all the threshold data for the different varieties 


    /*
        * Main Functions *
        - constructor () => Initialize a new contract
        - validate () => Validate that thresholds were met

        * Accessor Functions*
        -get_policy

        * Mutation Functions*
        -set_policy
    */

    // constructor() {
    //     policy = Policy(1, 1, "Hybrid Series 5", 1606063665, 1611334065);
    // }

    function get_policy() public view returns(Policy[] memory){
        return policies;
    }

    function add_policy(Policy memory _policy) public{
        policies.push(
            Policy(_policy.client_id, _policy.policy_id, _policy.maize_variety, _policy.start_date, _policy.end_date) 
        );
    }

    function validate(
        // Policy memory policy, //not sure why I put this here. 
        uint8[12] memory  weekly_rain_avgs, 
        uint8[3]  memory monthly_rain_avgs,
        uint8[12] memory  weekly_temp_avgs, 
        uint8[3]  memory monthly_temp_avgs
        ) public view returns (bool validation){

        bool weekly_rain_flag = true;
        bool monthly_rain_flag = true;
        bool weekly_temp_flag = true;
        bool monthly_temp_flag = true;

        for (uint8 i=0; i<11; i++){
            //check weekly rain averages
            if (weekly_rain_avgs[i] > Hybrid_Series_5.acceptable_weekly_rain_avgs[0] && weekly_rain_avgs[i] < Hybrid_Series_5.acceptable_weekly_rain_avgs[1]){
                weekly_rain_flag = weekly_rain_flag && true;
            } else {
                weekly_rain_flag = weekly_rain_flag && false;
            }

            //check weekly temp averages
            if (weekly_temp_avgs[i] > Hybrid_Series_5.acceptable_weekly_temp_avgs[0] && weekly_temp_avgs[i] < Hybrid_Series_5.acceptable_weekly_temp_avgs[1]){
                weekly_temp_flag = weekly_temp_flag && true;
            } else {
                weekly_temp_flag = weekly_temp_flag && false;
            }
        }

        for (uint8  i=0; i<2; i++){
            //check monthly rain averages
            if (monthly_rain_avgs[i] > Hybrid_Series_5.acceptable_monthly_rain_avgs[0] && monthly_rain_avgs[i] < Hybrid_Series_5.acceptable_monthly_rain_avgs[1]){
                monthly_rain_flag = monthly_rain_flag && true;
            } else {
                monthly_rain_flag = monthly_rain_flag && false;
            }

            //check monthly temp averages
            if (monthly_temp_avgs[i] > Hybrid_Series_5.acceptable_monthly_temp_avgs[0]&& monthly_temp_avgs[i] < Hybrid_Series_5.acceptable_monthly_temp_avgs[1]){
                monthly_temp_flag = monthly_temp_flag && true;
            } else {
                monthly_temp_flag = monthly_temp_flag && false;
            }
        }

        if (weekly_rain_flag && weekly_temp_flag && monthly_rain_flag && monthly_temp_flag){
            return false; // No payout, all conditions within normal range
        } else {
            return true; // Payout, conditions outside normal range
        }

    }

}
